    "#Fourier transfom of the all the sphere and after it multiply the fourier transform of the Gaussian Random field\n",
    "for i in range(33):\n",
    "    p = np.fft.fftn(grid[i,:,:])\n",
    "    p_1 = np.fft.fftshift(p)\n",
    "    #print(p_1)\n",
