    "#Calculating the mean and variance of the smoothing field of the sphere and Gaussian Random field\n",
    "t = []\n",
    "mean=[]\n",
    "for i in range(33):\n",
    "    m = np.mean(bp_3[i])\n",
    "    #print(m)\n",
    "    v = np.sum((bp_3[i]-m)**(2))/32\n",
    "    #print(v)\n",
    "    t.append(v)\n",
    "    mean.append(m)\n",
    "   "
