    "#The Mean and Variance of the smoothing field with Radii increases abruptly,Without Normalization we get the above type of plot \n",
    "of mean and variance.\n",
    "Effect of Normalization-\n",
    "1) Consistent Scaling- \n",
    "Normalization ensures that the smoothing and convolution functions are scaled consistently, which is essential for accurate results. Without normalization, the scaling of the functions can vary, leading to different levels of smoothing or convolution. This can affect the accuracy of the results and make them difficult to compare.\n",
    "2) Avoiding distortion-\n",
    "Normalization can prevent the smoothing and convolution functions from distorting the signal or data. If the functions are not normalized, they can amplify or attenuate certain frequencies or amplitudes, leading to a distorted output. Normalization helps to avoid this problem by ensuring that the function values are appropriately scaled.\n",
    "3)Removing bias-\n",
    "Normalizing the smoothing and convolution functions can also help to remove any bias in the results. Without normalization, the functions may be biased towards certain values or ranges of values. This can lead to inaccurate results and incorrect conclusions."
